import React from 'react';
import {Switch, Route} from 'react-router-dom';
import Servicios from './paginas/Servicios';
import cabeza from './componentes/Cabeza';


const routes = () =>{
    return(
        <Switch>
            <Route path="/" component={cabeza} exact/>
        </Switch>
    );
}
export default routes;
